DROP TABLE debt_cleaned;

CREATE TABLE debt_cleaned SELECT YEAR(effective_date) AS Year, intragovernmental_holdings, public_debt, total_debt FROM debt
WHERE effective_date IN (
SELECT max(effective_date) AS Max_Date_Per_Year FROM debt
GROUP BY YEAR(effective_date)
);

